import React from "react";
// import styles from "../modules/Emojis.module.css";

export default function Emojis() {
  const EmojisList = [
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
  ];
  const ls = EmojisList.map((e, i, a) => {
    <a key={i} href={e.a}>
      {e.s}
    </a>;
  });
  return <div>{ls}</div>;
}
